async function run(appId) {
    if (appId.startsWith('mcore.edu.'))
        return; // 교육용라이선스는 제거되면 안됨.
    const license = await licenseService.getLicenseByAppId(appId);
    if (license) {
        await libExports.remove(license.path);
    }
}

